import React, {useState} from 'react';



function NavBar () {

    return(
        <ul class="nav nav-underline" style={{marginLeft:"18px",marginRight:"18px"}}>
        <li class="nav-item">
          <a class="nav-link active" aria-current="page" href="#">Online-Pharmacy</a>
        </li>
        <li class="nav-item">
          <a class="nav-link"  href="#" style={{color:"black"}}>Link</a>
        </li>
        <li class="nav-item">
          <a class="nav-link" href="#">Link</a>
        </li>
        <li class="nav-item">
          <a class="nav-link disabled" aria-disabled="true">Disabled</a>
        </li>
      </ul>
    )


}


export default NavBar;
